import React from 'react'
import {Col,Button} from 'react-bootstrap'

const Cell = (props) => {
    return <Col>
        {props.selected ? props.selected : <Button onClick={()=>{props.selectCell(props.id)}} >Click</Button>}
    </Col>
}

export default Cell;
